  //   },
  //   {
  //     id: 2,
  //     message: "Its my first post",
  //     likeCounts: 45,
  //   },
  // ];

  let postsElement = props.posts.map((p) => <Post massage={p.message} likeCounts={p.likeCounts}/>)

  return (
    <div className={classes.postsBlock}>
      <h3>My posts</h3>
      <div>
        <div>
          <textarea></textarea>
        </div>
        <div>
          <button onClick={()=>{alert('hy')}}>Add post</button>
        </div>
      </div>
      <div className={classes.posts}>
        {postsElement}
      </div>
    </div>
  );
};

export default MyPosts;
